function App() {
  const user = null;
  return (
    <div className="App">

      <Router>
        {!user ? (
          <Login />

        ) : (
          <Switch>
            <Route exact path="/">
              <HomeScreen />
            </Route>

          </Switch>
        )}
    </Router>
    </div>



  );
}

export default App;
